import AppBar from '@mui/material/AppBar';
import Button from '@mui/material/Button';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardHeader from '@mui/material/CardHeader';
import CardMedia from '@mui/material/CardMedia';
import CssBaseline from '@mui/material/CssBaseline';
import Grid from '@mui/material/Grid';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import './App.css';
import CharacterCard from './CharacterCard';
import characters from './protagonists.json'


[
  {
      "name": "Buff-Cheeked Gibbon",
      "latin_name": "Hylobales gabriellae",
      "animal_type": "Mammal",
      "active_time": "Diurnal",
      "length_min": "1.5",
      "length_max": "2",
      "weight_min": "10",
      "weight_max": "12.5",
      "lifespan": "50",
      "habitat": "Tropical forest",
      "diet": "Fruit, leaves, and invertebrates",
      "geo_range": "Southeast Asia",
      "image_link": "https://upload.wikimedia.org/wikipedia/commons/c/c6/Nomascus_gabriellae_25.JPG",
      "id": 46
  },
  {
      "name": "Impala",
      "latin_name": "Aepyceros melampus",
      "animal_type": "Mammal",
      "active_time": "Diurnal",
      "length_min": "4.2",
      "length_max": "4.7",
      "weight_min": "99",
      "weight_max": "132",
      "lifespan": "15",
      "habitat": "Savannah and woodland",
      "diet": "Grasses and leaves",
      "geo_range": "Southern and East Africa",
      "image_link": "https://upload.wikimedia.org/wikipedia/commons/e/e1/Trotting_impala_ram%2C_crop.jpg",
      "id": 91
  }
]

function App() {
  return (
    <div className="App">
      <CssBaseline />
      <AppBar
        position="static"
        color="default"
        elevation={0}
        sx={{ borderBottom: '1px solid lightgray' }}
      >
        <Toolbar>
          <Typography variant="h6" sx={{ flexGrow: 1 }}>
            Characters Inc
          </Typography>
          <Button 
            href="#" 
            variant="outlined" 
            sx={{ my: 1, mx: 1.5 }}
            onClick={() => alert("Boop!")}
          >
            Button
          </Button>
        </Toolbar>
      </AppBar>
      <Container maxWidth="md" sx={{ my: 4}}>
        <Typography
          variant="h2"
          align="center"
          color="text.primary"
          sx={{ py: 2}}
        >
          Prevalent Protagonists
        </Typography>
        <Typography 
          variant="h5" 
          align="center" 
          color="text.secondary"
          sx={{ mx: 10 }}
        >
          Hmm, seems like we're missing some of the other protagonists.
        </Typography>
      </Container>
      {/* End hero unit */}

      <Container maxWidth="lg">
        <Grid container 
          spacing={5} 
          justifyContent="center"
          alignItems="flex-start"
        >
          {characters.map((data) =>
          <Grid
          item
          xs={12}
          md={4}
          >
          <CharacterCard
            characterName={data.title}
            image={data.pic}
            descriptionArray={data.description}
          />
        </Grid>
        )}

        </Grid>
      </Container>
    </div>
  );
}

export default App;
